About Game:
************
Wings!(tm), the classic flight-combat action game from the Amiga generation is back! With &quot;Wings! Remastered Edition&quot; Cinemaware brings you back to an experience full of blasting action, drama and emotions. Get your Sopwith Camel started and dive deep into this amazing story of a WWI combat pilot's life experience. Fight your foes in one-on-one air combat, bomb enemy installations and strafe enemy supply lines!

Re-live a True Classic!
************************
Wings! Remastered Edition is the great comeback of the Amiga hit-game from 1990. The game has been completely reproduced in stunning HD graphics, high-quality sound effects and a masterful soundtrack re-scored with real instruments. Jump into the cockpit and enjoy this remastered classic game experience!
